INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 2, "リリ", 1, 0, 40011, 1, 1, 125801);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 2, "クリア", 1, 0, 40011, 1, 2, 126001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (323, "んーと。\nこれ、あげる。\nはい", 24001, 2, "プレシア", 1, 0, 40011, 1, 3, 126101);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 2, "リリ", 2, 0, 40011, 1, 4, 125801);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 2, "クリア", 2, 0, 40011, 1, 5, 126001);
INSERT INTO `v1_b5b75089bbea3e8f88d466febc30d43722e68857680cd87864c98df21a2e9e10` VALUES (326, "お兄。\nきてくれて、うれしい", 24001, 2, "プレシア", 2, 0, 40011, 1, 6, 126101);
